const canvas = document.createElement('canvas')
const ctx = canvas.getContext('2d')
canvas.width = 800
canvas.height = 500

const irineu = 'data:image/jpeg;base64,'

const sosia = 'data:image/jpeg;base64,'

const a1010 = 'data:image/jpeg;base64,';

const selo = new Image()
selo.src = 'data:image/png;base64,'

const fontSize = 50
const seloSize = 256

function getLines(text, maxWidth = 720) {
    var words = text.split(" ");
    var lines = [];
    var currentLine = words[0];

    for (var i = 1; i < words.length; i++) {
        var word = words[i];
        var width = ctx.measureText(currentLine + " " + word).width;
        if (width < maxWidth) {
            currentLine += " " + word;
        } else {
            lines.push(currentLine);
            currentLine = word;
        }
    }
    lines.push(currentLine);
    return lines;
}


function writeText (text, x, y) {
	const lines = getLines(text)
	
	for (let l in lines) {
		ctx.fillText(lines[l], x, y + (fontSize * l))
	}
}

new Vue({
	el: "#app",

	data() {
		return {
			url: '',
			form: {
				alg: "Eis que",
				sujeito: 'voc',
				img: {text: 'sosia do vin diesel', src: sosia},
				acao: 'cagakkkkkkkkkkkkkkkkkkkkk'
			},
			algoritimos: ["Eis que", "Quando", "A", "Como"],
			sujeitos: ["voc", "a 10/10", "irineu"],
			acao: "cagakkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkk",
			imagens: [
				{text: 'irineu', src: irineu},
				{text: 'sosia do vin diesel', src: sosia},
				{text: '10/10', src: a1010}
			]
		};
	},
	
	watch: {
		form: {
			deep: true,
			handler(){
				this.process()
			}
		}
	},
	mounted(){
		selo.onload = () => this.process()
	},
	computed: {
		nomeArquivo(){
			return [this.form.alg, this.form.sujeito, this.form.acao].join('_').replace(/\s+/gm, '_')+'.png'
		}
	},
	methods: {
		save(){
			const blob = canvas.toBlob('image/jpeg')
			console.log(blob)
		},
		process(){
			const { alg, img, sujeito, acao} = this.form
			const pic = new Image()
			const texto = [alg, sujeito, acao].join(' ')
			
			ctx.font = '50px Arial'
			
			pic.onload = () => {
				ctx.clearRect(0, 0, canvas.width, canvas.height)
				ctx.drawImage(pic, 0, 0, canvas.width, canvas.height)
				ctx.drawImage(selo, canvas.width - seloSize, canvas.height - seloSize, seloSize, seloSize)
				writeText(texto, 32, fontSize)
				this.url = canvas.toDataURL('image/jpeg')
			}
			
			pic.src = img.src
		}
	}
});
